#coding utf-8
import time
from functools import reduce
def pattern132(nums):
    func =lambda x, y: x if y in x[-1:] else x + [y]
    nums =reduce(func, [[], ] + nums)
    while(len(nums) > 2):
        if min(nums) == nums[-1]:
            nums.pop(-1)
        elif max(nums)==nums[-1]:
            nums.pop(-1)
        elif max(nums)==nums[0]:
           nums.pop(0)
        elif min(nums)==nums[-2]:
            nums.pop(-2)
        elif len(set(nums)) < 3:
            return False
        else:
            break
    else:
        return False
    Max = max(nums)
    ind=nums.index(Max)
    s_f=set(nums[:ind])
    s_b=set(nums[ind+1:])-{Max}
    n1=min(s_f)
    n2=max(s_b)
    #print(n1,Max,n2)
    if n1<n2:
        return True
    else:
        nums.pop(ind)
        return pattern132(nums)
